DROP TABLE IF EXISTS `ACT_DE_CALENDAR`;
CREATE TABLE `ACT_DE_CALENDAR`
(
    `ID`               int(11)     NOT NULL AUTO_INCREMENT,
    `DATE_CODE`        varchar(50) NOT NULL COMMENT '日期编码',
    `DATE`             date         DEFAULT NULL COMMENT '日期',
    `SOLAR_DATE`       varchar(50)  DEFAULT NULL COMMENT '阳历',
    `LUNAR_DATE`       varchar(50)  DEFAULT NULL COMMENT '农历',
    `YEAR_CODE`        varchar(10)  DEFAULT NULL COMMENT '年份编码',
    `SEXAGENARY_CYCLE` varchar(50)  DEFAULT NULL COMMENT '干支',
    `CHINESE_ZODIAC`   varchar(50)  DEFAULT NULL COMMENT '生肖',
    `SOLAR_TERMS`      varchar(50)  DEFAULT NULL COMMENT '节气',
    `ZODIAC`           varchar(50)  DEFAULT NULL COMMENT '星座',
    `FESTIVALS`        varchar(100) DEFAULT NULL COMMENT '节日',
    `IF_WEEKEND`       bit(1)       DEFAULT NULL COMMENT '是否周末',
    `WEEK_CODE`        varchar(10)  DEFAULT NULL COMMENT '星期编码',
    `WEEK`             varchar(50)  DEFAULT NULL COMMENT '星期',
    `HALF_DAY_SIGN`    int(11)      DEFAULT '0' COMMENT '半天标识',
    `HALF_DAY_DESC`    varchar(20)  DEFAULT '全天' COMMENT '半天描述',
    `HOLIDAY_SIGN`     int(11)      DEFAULT '0' COMMENT '节假日标识',
    `HOLIDAY_DESC`     varchar(20)  DEFAULT '上班' COMMENT '节假日描述',
    `HOLIDAY_NOTES`    varchar(100) DEFAULT NULL COMMENT '节假日备注',
    `CODE`             varchar(100) DEFAULT NULL COMMENT '编码',
    `GROUP_CODE`       varchar(100) DEFAULT NULL COMMENT '组编码',
    PRIMARY KEY (`ID`),
    UNIQUE KEY `'UNIQUE_DATE_CODE'` (`DATE_CODE`)
) ENGINE = InnoDB
  AUTO_INCREMENT = 5116
  DEFAULT CHARSET = utf8mb4
  ROW_FORMAT = DYNAMIC COMMENT ='主日历';

